import { Row, Col, Card, CardTitle, CardText, Button } from 'reactstrap';


export default function Cuestionario(props) {
  const [contPre, setcontPre] = useState(0)
  return (
    <Row>
      <Col>
        <Card body>
          <CardTitle tag="h5">
            Cuestionario addicción móvil
          </CardTitle>
          <CardText>
            {props.pregunta}
          </CardText>
          <Row sm={6}>
            <Button >
              Si
            </Button>
            <Button >
              No
            </Button>
          </Row>
        </Card>
      </Col>
    </Row>
  );

}
